import React, { Component } from 'react';


class Mole extends Component {
  render() {
    return (
      <div className="container-item">
        <img src={'img/WAM_Hole.png'} alt="" onClick={()=>{alert('clicked')}}/>
      </div>
    );
  }
}

export default Mole;
